using DomainLayer.Converters;
using DomainLayer.Entities;
using DomainLayer.Enums;
using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;

namespace InfrastructureLayer.Context.Configuratoins
{
    public class PersonCnofiguration : IEntityTypeConfiguration<Person>
    {
        public void Configure(EntityTypeBuilder<Person> builder)
        {

            builder.ToTable("People");


            builder.HasKey(p => p.Id);


            builder.Property(p => p.Id).ValueGeneratedOnAdd();


            builder.Property(p => p.NationalNO).HasMaxLength(10).IsRequired();


            builder.HasAlternateKey(p => p.NationalNO).HasName("UQ_National_NO");


            builder.Property(p => p.FirstName).HasMaxLength(50).IsRequired();


            builder.Property(p => p.SecondName).HasMaxLength(50).IsRequired();


            builder.Property(p => p.ThirdName).HasMaxLength(50).IsRequired();


            builder.Property(p => p.LastName).HasMaxLength(50).IsRequired();


            builder.Property(p => p.Gender).HasColumnType("bit").IsRequired().HasConversion(g => enGnderConverter.Converter(g), g => enGnderConverter.Converter(g));


            builder.Property(p => p.DateOfBirth).HasColumnType("date").IsRequired();


            builder.Property(p => p.ImagePath).HasMaxLength(500);


            builder.HasOne(p => p.Nationality).WithMany().HasForeignKey(p => p.NationalityID);



            builder.ToTable(t => t.HasCheckConstraint("CK_Person_FirstName", "FirstName LIKE '%[A-Za-z ]%'"));


            builder.ToTable(t => t.HasCheckConstraint("CK_Person_SecondName", "SecondName LIKE '%[A-Za-z ]%'"));


            builder.ToTable(t => t.HasCheckConstraint("CK_Person_ThirdName", "ThirdName LIKE '%[A-Za-z ]%'"));


            builder.ToTable(t => t.HasCheckConstraint("CK_Person_LastName", "LastName LIKE '%[A-Za-z ]%'"));


            builder.ToTable(t => t.HasCheckConstraint("CK_Age", "(datediff(year,[DateOfBirth],getdate())>=(15))"));


            builder.ToTable(t => t.HasCheckConstraint("CK_Person_NationalNO", "NationalNO LIKE '%[0-9]%'"));


            builder.ToTable(t => t.HasCheckConstraint
            ("CK_ImagePath", "([ImagePath] like '%[A-Za-z0-9]:/%'" +
                   " AND NOT [ImagePath] like '%[^A-Za-z0-9/:/./_/-/ ]%'" +
                   " AND ([ImagePath] like '%.jpg'" +
                   " OR [ImagePath] like '%.jpeg'" +
                   " OR [ImagePath] like '%.png'" +
                   " OR [ImagePath] like '%.gif'" +
                   " OR [ImagePath] like '%.bmp'" +
                   " OR [ImagePath] like '%.tiff'))")
            );

            builder.HasData(LoadPersons());

        }
